    public function valuation($params)
    {
        $brand = $params['brand'];
        $series = $params['series'];
        $model = $params['model'];
        $date = $params['date'];
        $city = $params['city'];
        $kilometer = $params['kilometer'];

        $series_id = 0;$model_id = 0;$province_id = 0;$city_id = 0;$url = '';
        $brand_id = DB::table('chechong_brands')->where('name', $brand)->pluck('id');
        if(!is_null($brand_id)) {
            $series_id = $this->getSeriesId($brand_id, $series, $brand);
            if(!is_null($series_id)) {
                $model_id = $this->getModelId($series_id, $model);
                $province = DB::table('cities')->where('name', $city)->pluck('province');
                list($city_id, $province_id) = $this->getProvinceCityId($city, $province);
                if(!is_null($province_id) && !is_null($model_id) && !is_null($city_id)) {
//                    $formatted_date = str_replace('-', '_', $date);
//                    $url = "http://www.chechong.com/gujia/{$model_id}_{$formatted_date}_{$province_id}_{$city_id}_". ($kilometer*100) ."_0_0_0/";
                    $url = "http://m.chechong.com/Assessment/result/";
                    list($year, $month) = explode('-', $date);
                    $valuation_param = [
                        's_brand' => $brand_id,
                        's_series' => $series_id,
                        's_simple' => $model_id,
                        's_year' => $year,
                        's_mouth' => $month,
                        's_province' => $province_id,
                        's_city' => $city_id,
                        's_licheng' => $kilometer*100
                    ];
                    $result = $this->getDealPrice($url, $valuation_param);
                    if(!is_null($result)) {
                        $result['url'] = $url;

                        return $result;
                    }
                }
            }
        }

        return [
            'normal_dealer_price' => '',
            'low_dealer_price' => '',
            'high_dealer_price' => '',
            'url' => '',
            'msg' => "brand_id->{$brand_id}|series_id->{$series_id}|model_id->{$model_id}|province_id->{$province_id}|city_id->{$city_id}|url->{$url}"
        ];
    }

