    /**
     * query series id
     * @param $brand_id
     * @param $series
     * @param $brand
     * @return null
     */
    private  function getSeriesId($brand_id, $series, $brand)
    {
//        $url = 'http://www.chechong.com/Index/showSeries/';
//        $result = $this->snoopySubmit($url, ['b_id' => $brand_id], $this->is_proxy);
        $url = 'http://m.chechong.com/Assessment/getSeries/';
        $result = $this->snoopySubmit($url, ['brand_id' => $brand_id]);

//        $result = '{'.mb_substr($result, 2);
        $result = json_decode($result, true);
        $series_list = $result['series'];

        if(!empty($series_list)) {
            //途锐 => 途锐(进口) && strip 两厢/三厢/三门版/五门版
            $flag = false;
            $appendStr = '(进口)';

            foreach ($series_list as &$one_series)
            {
                $series_name_patterns = [
                    '/两厢/',
                    '/三厢/',
                    '/三门版/',
                    '/五门版/',
                ];
                $one_series['name'] = preg_replace($series_name_patterns, '', $one_series['name']);

                if ($one_series['isshow'] == 0 && strpos($one_series['name'], $appendStr))
                {
                    $flag = true;
                    continue;
                }
                if ($flag)
                {
                    $one_series['name'] .= $appendStr;

                    if ($one_series['isshow'] == 0)
                    {
                        $flag = false;
                    }
                }
            }
            foreach ($series_list as $one_series) {
                if($one_series['name'] == $series
                    || $brand. $one_series['name'] == $series
                    || $one_series['name'] == $brand. $series
                ) {

                    return $one_series['id'];
                }
            }
        }

        return null;
    }

