    /**
     * model name if suit or not
     * @param $gpjModelName
     * @param $otherModelName
     * @return bool
     */
    private function modelNameSuit($gpjModelName, $otherModelName)
    {
        $gpjModelName = parent::modelNameAdjustment($gpjModelName);
        $otherModelName = parent::modelNameAdjustment($otherModelName);

        $gpjModelArray = array_filter(explode(' ', strtoupper($gpjModelName)));
        $otherModelArray = array_filter(explode(' ', strtoupper($otherModelName)));

        $intersect = array_values(array_intersect($gpjModelArray, $otherModelArray));
        if($intersect == $gpjModelArray || $intersect == $otherModelArray) {

            return true;
        }

        return false;
    }

    private function getProvinceCityId($city, $province){
        $city_array = json_decode($this->cityData, true);
        foreach ($city_array as $one_city) {
            if($one_city['n'] == $city && $one_city['l'] == 2) {
                $city_id = $one_city['k'];
            }
            if($one_city['n'] == $province && $one_city['l'] == 1) {
                $province_id = $one_city['k'];
            }
        }
        if(isset($city_id) && isset($province_id)) {

            return [$city_id, $province_id];
        }

        return [];
    }

